import Button from '../Button';
import Checkbox from '../Checkbox';
import Form from '../Form';
import Illustration from '../Illustration';
import classes from '../styles/Signup.module.css';
import TextInput from '../TextInput';
import signupImage from './assets/images/signup.svg';

export default function Signup() {
  return (
    <>
      <h1>Create an account</h1>

      <div className="column">
        <Illustration image={signupImage} />
        <Form className={classes.signup}>
          <TextInput type="text" placeholder="Input name" icon="person" />

          <TextInput type="text" placeholder="Input email" icon="alternate_email" />

          <TextInput type="password" placeholder="Input password" icon="lock" />

          <TextInput type="password" placeholder="Confirm password" icon="lock_clock" />

          <Checkbox type="checkbox" text="I agree to the Terms & Conditions" />

          <Button>
            Submit now
          </Button>

          <div className="info">
            Already have an account? <a href="login.html">Login</a> instead.
          </div>
        </Form>
      </div>
    </>
  );
}
